import React from 'react';

import {
  Modal,
  ModalBody,
  ModalTitle,
  ModalFooter,
  Button,
} from 'react-bootstrap';

export default function ScreenModal({ children }) {
  return (
    <Modal visible>
      <ModalTitle>VISUALIZAR PROBLEMA</ModalTitle>
      <ModalBody>{children}</ModalBody>
      <ModalFooter>
        <Button variant="outline-primary">Fechar</Button>
      </ModalFooter>
    </Modal>
  );
}
